import { Link } from "react-router-dom"

const EVENTS = [
    {id:'event1' , title:'some event' },
    {id:'event2' , title:'some event' },
    {id:'event3' , title:'some event' }
]

export default function EventsPage(){
    return <>
        <ul>
            {EVENTS.map((event)=> {
                return <li key={event.id}  ><Link> {event.title}  </Link>   </li>
            })}
        </ul>

    </>
}
